import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


const App=()=>
              {
                const now=new Date()
                const a=4
                const b=6

                return(<div>
                        <p>Hello World, it is now {now.toString()}</p>
                        <p>{a} + {b} is equal to {a+b}</p>
                        </div>)
              }

ReactDOM.render(
  <App />,
   document.getElementById('root')
);
